// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

import "./interfaces/IERC20.sol";
import "./interfaces/SushiSwap.sol";
import "./interfaces/Aave.sol";


contract Sushiswap {
  address private constant SUSHI_ROUTER = 0xd9e1cE17f2641f24aE83637ab66a2cca9C378B9F; 
  address private constant WETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;


  /* I know its somewhat disrespectful to change the name of the all the uniswap variables to Sushiswap,
  as it is a fork of Uniswap, but this was very confusing and even worses if Uniswap support is added

  */
  function swap(address _tokenIn, address _tokenOut, uint _amountIn, uint _amountOutMin, address _to) external {
    IERC20(_tokenIn).transferFrom(msg.sender, address(this), _amountIn);
    IERC20(_tokenIn).approve(SUSHI_ROUTER, _amountIn);

    address[] memory path;
    path = new address[](3);
    path[0] = _tokenIn;
    path[1] = WETH;
    path[2] = _tokenOut;

    SushiSwapRouter(SUSHI_ROUTER).swapExactTokensForTokens(_amountIn,_amountOutMin,path,_to,block.timestamp);
  }

  function getAmountOutMin(address _tokenIn, address _tokenOut, uint _amountIn) external view returns (uint) {
    address[] memory path;
    if (_tokenIn == WETH || _tokenOut == WETH) {
      path = new address[](2);
      path[0] = _tokenIn;
      path[1] = _tokenOut;
    } else {
      path = new address[](3);
      path[0] = _tokenIn;
      path[1] = WETH;
      path[2] = _tokenOut;
    }

    // same length as path
    uint[] memory amountOutMins = SushiSwapRouter(SUSHI_ROUTER).getAmountsOut(_amountIn, path);

    return amountOutMins[path.length - 1];
  }

}
